'pull_request': {'url': 'https://api.github.com/repos/Azure/azure-iot-sdk-java/pulls/1535', 'html_url': 'https://github.com/Azure/azure-iot-sdk-java/pull/1535', 'diff_url': 'https://github.com/Azure/azure-iot-sdk-java/pull/1535.diff', 'patch_url': 'https://github.com/Azure/azure-iot-sdk-java/pull/1535.patch', 'merged_at': None}, 'body': "Previously, the sample wouldn't work well for users who either don't send telemetry/reported properties often or who don't do it at all. This is because the client manager would only attempt to reconnect once it tried to send telemetry/reported properties and failed because the client was closed. This meant that a client could be offline (and missing direct method calls and desired property updates) for a while.

With this rework, the sample will now immediately start reconnecting if a terminal disconnection event occurs regardless of if there is any outgoing telemetry and/or reported properties. The only drawback here is that we now have two threads in the sample which may be confusing. I've created a more robust readme to explain those threads though.

