{'action': 'opened', 'number': 1535, 'pull_request': {'url': 'https://api.github.com/repos/Azure/azure-iot-sdk-java/pulls/1535', 'id': 910411337, 'node_id': 'PR_kwDOBDpjjs42Q8ZJ', 'html_url': 'https://github.com/Azure/azure-iot-sdk-java/pull/1535', 'diff_url': 'https://github.com/Azure/azure-iot-sdk-java/pull/1535.diff', 'patch_url': 'https://github.com/Azure/azure-iot-sdk-java/pull/1535.patch', 'issue_url': 'https://api.github.com/repos/Azure/azure-iot-sdk-java/issues/1535', 'number': 1535, 'state': 'open', 'locked': False, 'title': 'refactor(sample): Rework reconnection sample a bit', 'user': {'login': 'timtay-microsoft', 'id': 28789848, 'node_id': 'MDQ6VXNlcjI4Nzg5ODQ4', 'avatar_url': 'https://avatars.githubusercontent.com/u/28789848?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/timtay-microsoft', 'html_url': 'https://github.com/timtay-microsoft', 'followers_url': 'https://api.github.com/users/timtay-microsoft/followers', 'following_url': 'https://api.github.com/users/timtay-microsoft/following{/other_user}', 'gists_url': 'https://api.github.com/users/timtay-microsoft/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/timtay-microsoft/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/timtay-microsoft/subscriptions', 'organizations_url': 'https://api.github.com/users/timtay-microsoft/orgs', 'repos_url': 'https://api.github.com/users/timtay-microsoft/repos', 'events_url': 'https://api.github.com/users/timtay-microsoft/events{/privacy}', 'received_events_url': 'https://api.github.com/users/timtay-microsoft/received_events', 'type': 'User', 'site_admin': False}, 'body': "Previously, the sample wouldn't work well for users who either don't send telemetry/reported properties often or who don't do it at all. This is because the client manager would only attempt to reconnect once it tried to send telemetry/reported properties and failed because the client was closed. This meant that a client could be offline (and missing direct method calls and desired property updates) for a while.

With this rework, the sample will now immediately start reconnecting if a terminal disconnection event occurs regardless of if there is any outgoing telemetry and/or reported properties. The only drawback here is that we now have two threads in the sample which may be confusing. I've created a more robust readme to explain those threads though.

