- **OS and version used:** Docker container based on alpine 3.15 (eclipse-temurin:17-alpine)
- **Java runtime used:** openjdk version "17.0.1" 2021-10-19
- **SDK version used:** iot-device-client:1.34.2

## Description of the issue
I work on a gateway for iot devices. Devices are connected to my server application and the application is connected to the IoT Hub through a multiplexed AMQP connection (MultiplexingClient).
Each time a device connects to the gateway, a DeviceClient is created and registered to the MultiplexingClient.
Each time a device disconnects, the DeviceClient is unregisters from the MultiplexingClient.
To send command to the devices through the IoT Hub I subscribe to deviceMethod.

Connections, disconnection, device-to-cloud and cloud-to-device messages, everything seems ok but, during stress test with a lot of connections/disconnections the application crash after some hours because of excessive memory consumption (the application container is managed by k8s and we set limits).

We also noticed than the more the application run, the more the response time to cloud-to-device request is bad: about 90 ms after the beginning more than 10s after few hours.

I profiled the application and it seems there is a memory leak. All objects are not released after device disconnection, and specifically objects on DeviceMethod.

I supposed there's a link with my increasingly bad response times.

Below the capture of the profiler after few hours:
- 749 living DeviceClient objects is more or less the actual devices count connected at this moment
- 15347 living objects for DeviceClientConfig and DeviceMethod callbacks seems the origin of my issues.

![image](https://user-images.githubusercontent.com/766129/156567355-a59221f8-00b3-4ced-8638-4f4998b7a41d.png)


Thanks for your support!

## Code sample exhibiting the issue

Here, a extract of my kotlin code where I register/unregister devices

```
    val deviceConnections = mutableMapOf<String, DeviceClient>()
    private val multiplexingClient = MultiplexingClient(hubProperties.hostName, IotHubClientProtocol.AMQPS)

    init {
        this.multiplexingClient.open()
    }
    
    /**
     * Open connection tu IoT Hub and reference it.
     */
    fun openConnection(
        deviceId: String,
        key: String,
        onConnectionClose: () -> Unit
    ) {
        // check if there's already a connection
        if (this.deviceConnections[deviceId] == null) {
            try {
                val deviceConnectionString = this.connectionStringUtils.deviceConnectionString(deviceId, key)
                val client = DeviceClient(deviceConnectionString, IotHubClientProtocol.AMQPS)

                client.registerConnectionStatusChangeCallback(
                    { status, reason, throwable, _ ->
                        this.logger.info(
                            "connection status has changed to '{}', reason: {}, throwable: {}",
                            status,
                            reason,
                            throwable
                        )

                        if (status == IotHubConnectionStatus.CONNECTED) {
                            this.deviceConnections[deviceId] = client
                            this.listen(deviceId)
                        }

                        if (status == IotHubConnectionStatus.DISCONNECTED) {
                            this.deviceConnections.remove(deviceId)
                            onConnectionClose()
                        }
                    },
                    null
                )

                this.multiplexingClient.registerDeviceClient(client)
            } catch (e: Exception) {
                this.logger.warn("cannot connect device '$deviceId' to iot hub: ${e.message}")
            }
        } else {
            this.logger.warn("connection already opened for {}", deviceId)
        }
    }

    /**
     * Close connection to IoT Hub and remove reference.
     */
    fun closeConnection(
        deviceId: String
    ) {
        val client = this.deviceConnections[deviceId]
        if (client != null) {
            this.multiplexingClient.unregisterDeviceClient(client)
            this.logger.info("close iot hub connection for device '$deviceId'")
        } else {
            this.logger.warn("device '$deviceId' was not connected to iot hub")
        }
    }
    
    /**
     *
     */
	fun listen(
        deviceId: String
    ) {
        this.getClientForDeviceAndApply(
            deviceId,
            { deviceClient ->
                try {
                    deviceClient.subscribeToDeviceMethod(
                        { methodName, methodData, _ ->
                            this.logger.debug("$deviceId - direct method call received for method $methodName")
                            when (methodName) {
                                "meth0" -> doSomething0()
                                "meth1" -> doSomething1()
                                else -> this.logger.warn("$deviceId - unexpected direct method name $methodName")
                            }
                            this.logger.debug("$deviceId - send direct method response")
                            return@subscribeToDeviceMethod DeviceMethodData(200, "OK")
                        },
                        null,
                        { responseStatus, _ ->
                            this.logger.debug("$deviceId - iot hub device method callback status: $responseStatus")
                        },
                        null,
                    )
                } catch (e: Exception) {
                    this.logger.error("$deviceId - direct method handling error: ${e.message}")
                }
            },
            {
                this.logger.warn("no iot hub device client found for id $deviceId")
            },
        )
    }

